import { useState } from "react"
import { instance } from "../services"

export const getDataMenu = async (type, page) => {
    const [minPriceJp, setMinPriceJp] = useState()
    const response = await instance.get(`https://www.soldout.co.kr/api/v3/search/get-item-list?&typeGb=goods&pageIndex=${page}&pageSize=24&keyword=${type}`)
    const data = response.data.data.product_info.list.map(
        (item) => {
            for (let i = 0; i < item.model_no.length; i++) {
                if (item.model_no[i] == ' ') {
                    item.model_no = item.model_no.slice(0, item.model_no.length - i)
                }
            }
            const getMinPriceJp = async() => {
                const responseJP = await instance.get(`https://snkrdunk.com/v1/products/CW2288-111/sales-history?`)
                setMinPriceJp(responseJP)
            }
            get
            return {
                code: item.model_no,
                type: item.brand_name_eng,
                min_price: item.min_price,
                name: item.name_eng,
                img: item.image_path
            }

        }
    )



    return data
}
